INSERT INTO `thistoriaofert` VALUES (1,0,1090.00,20,65,'Santa Susanna','Kraków',30,'2005-10-01 17:00:00','Hotel RIVIERA *** położony jest około 100 m od plaży przy głównej promenadzie nadmorskiej. Wyposażenie: Do dyspozycji gości klimatyzowana restauracja, drink bar, snack bar, bar przy basenie, sala telewizyjna, winda, sala wypoczynkowa, recepcja czynna całą dobę, hol, winda, restauracja i kawiarnia przy pasażu, punkt wymiany walut.Pokoje: Pokoje klimatyzowane 2-, 3-, 4-osobowe z łazienką (prysznic wc) i balkonem. W każdym pokoju TV sat oraz telefon.WYŻYWIENIE: Trzy posiłki: śniadania, obiady i kolacje podawane w formie bufetu.Sport i rozrywka: Na terenie hotelu znajduje się basen, leżaki przy basenie - bezpłatnie, brodzik dla dzieci, plac zabaw, stoły bilardowe oraz do gry w tenisa stołowego, automaty do gier. Codziennie w hotelu odbywają się imprezy rozrywkowe (dancingi, pokazy flamenco itp.).'),(2,0,600.00,40,85,'Nei Pori','Kraków',28,'2005-04-19 16:00:00','HOTEL ARONIS *** położony ok. 50 m od morza, posiada pokoje 2 i 3 osobowe z możliwością dostawki, z klimatyzacją, łazienką, TV-SAT, telefonem i balkonem. Na parterze znajduje się bar i restauracja otoczona obszerną werandą. WYŻYWIENIE w restauracji hotelowej, to kuchnia grecka: serwowane porcje śniadaniowe i serwowane dwu daniowe obiadokolacje (napoje do obiadokolacji płatne są dodatkowo).HOTEL ADONIS *** położony jest w centrum miasteczka, ok. 5 min. spacerem od morza. Hotel dysponuje pokojami 2 i 3 osobowymi z klimatyzacją, łazienką, telefonem i TV-SAT oraz balkonem. WYŻYWIENIE w kawiarni hotelowej serwowane są śniadania, natomiast dwu daniowe obiadokolacje serwowane są w sąsiedniej tawernie (napoje do obiadokolacji płatne są dodatkowo).'),(3,0,350.00,35,85,'Kokino Nero','Kraków',28,'2005-04-25 18:00:00','HOTEL HILDI *** położony jest ok. 2 min od morza. od plaży. Pokoje są 2 osobowe ale niektóre wyposażone są w szerokie podwójne łóżka i dlatego jest możliwość zakwaterowania 3 i 4 osoby w pokoju. Wszystkie pokoje posiadają łazienkę, TV-SAT i klimatyzację. WYŻYWIENIE: serwowane porcje śniadaniowe i serwowane dwu daniowe obiadokolacje (napoje do obiadokolacji płatne są dodatkowo).'),(4,0,575.00,15,22,'Obzor','Kraków',10,'2005-12-21 07:00:00','APARTAMENTY to samodzielne mieszkania przeznaczone dla 4 osób, posiadają dwie sypialnie, łazienkę i kuchnię z podstawowym wyposażeniem do przyrządzania posiłków, kuchenką i lodówką.WYŻYWIENIE: we własnym zakresie lub na zamówienie. '),(5,0,745.00,30,94,'Tisno','Kraków',14,'2005-01-09 12:00:00','HOTEL BOROVNIK ***  zlokalizowany jest w środku miasteczka, przy samym wybrzeżu, ok. 15 min. od plaży. Gruntownie wyremontowany w 1997 roku, należy do grupy obiektów z bogatym doświadczeniem hotelarskim. Hotel oferuje różnorodne atrakcje: otwarty basen z morską wodą, wieczorny i dzienny taras, salon fryzjerski, kantor, sklep z pamiątkami. Pokoje są 2 osobowe z łazienkami, TV-SAT, mini barem i telefonem. Restauracja hotelowa oprócz dużego wyboru specjałów kuchni dalmatyńskiej oferuje wyśmienite wina domowe, a wieczorami organizowane są dancingi na świeżym powietrzu.WYŻYWIENIE 2x dziennie: śniadania (z ciepłymi napojami: kawa, herbata, mleko, kakao) i obiadokolacje (napoje do obiadokolacji są dodatkowo płatne), w formie bufetu szwedzkiego .'),(6,0,290.00,21,94,'Murter','Kraków',21,'2005-12-30 12:00:00','APARTAMENTY to niekrępujące, samodzielne, skromnie urządzone mieszkania mieszczące się w prywatnych domach położonych ok. 15 min od plaży. Każdy apartament posiada: pokój dzienny, zwykle przejściowy umeblowany w: komplet wypoczynkowy, stół, krzesła, kredens, aneks kuchenny z wyposażeniem (szafki kuchenne, kuchenka, lodówka, naczynia kuchenne), łazienkę /WC jest to pełny węzeł sanitarny z prysznicem, umywalką, ciepłą i zimną wodą, WC, sypialnie: w apartamencie 2-osobowym jest 1 sypialnia z 2 łóżkami, w 4-osobowym są 2 sypialnie, w 6-sobowym są 3 sypialnie 2 osobowe. WYŻYWIENIE: we własnym zakresie'),(7,0,1160.00,32,94,'Podgora','Kraków',21,'2005-02-05 16:00:00','APARTAMENTY  to niekrępujące, samodzielne, skromnie urządzone mieszkania mieszczące się w prywatnych willach. Każdy apartament posiada: salonik - pokój dzienny, zwykle przejściowy w pełni umeblowany: komplet wypoczynkowy, stół, krzesła, kredens, aneks kuchenny z pełnym wyposażeniem (szafki kuchenne, kuchenka , lodówka, naczynia kuchenne), łazienkę /WC jest to pełny węzeł sanitarny z prysznicem, umywalką, ciepłą i zimną wodą, WC, sypialnie: w apartamencie 2-osobowym jest 1 sypialnia z 2 łóżkami, w 4-osobowym są 2 sypialnie. WYŻYWIENIE: we własnym zakresie.'),(8,0,830.00,40,94,'Primosten','Kraków',7,'2005-05-22 11:00:00','APARTAMENTY - to niekrępujące, samodzielne mieszkania. Każdy apartament posiada: pokój dzienny, zwykle przejściowy umeblowany w: komplet wypoczynkowy, stół, krzesła, kredens, aneks kuchenny z wyposażeniem (szafki kuchenne, kuchenka czteropalnikowa, lodówka, naczynia kuchenne), łazienkę /WC z prysznicem, umywalką, ciepłą i zimną wodą, WC, sypialnie: w apartamencie 2-osobowym jest 1 sypialnia z 2 łóżkami, w 4-osobowym są 2 sypialnie, w 6-sobowym są 3 sypialnie 2 osobowe. WYŻYWIENIE: we własnym zakresie. Na miejscu istnieje możliwość wykupienia wyżywienia w restauracji np. śniadań w cenie od ok. 30 EUR i obiadokolacji od ok. 45 EUR.'),(9,0,615.00,24,94,'Brać','Kraków',24,'2005-06-28 10:00:00','KOMPLES WAKACYJNY WATERMAN RESORTS - położony w miejscowości Supetar, ok.700 m od centrum znajdującego się przy zatoce, do której przybijają promy. Kompleks usytuowany jest w piniowym zagajniku roztaczającym przyjemny cień nad schodzącymi łagodnie do morza kamienistymi zatokami. Odległość od plaży wynosi ok.50 m. W skład kompleksu Waterman wchodzą hotele KAKTUS,ADRIA, pawilony hotelowe OLEA, SALVIA, ADRIA,AGAVA, osiedle WILLI, wellness centrum, odkryte baseny z wodą słodką. Sport i rozrywka: 9 kortów tenisowych, centrum nurkowe, mini-golf, tenis stołowy, wynajem leżaków i parasoli, wypożyczalnia skuterów wodnych, sprzętu pływającego, wypożyczalnia rowerów, boisko do piłki nożnej, plażowy bar, siatkówka plażowa, kule, animacje - programy rozrywkowe, dostęp do internetu;. Wellness centrum - kryty basen z wodą słodką (czynny przed i po sezonie), odkryty basen z wodą słodką, fitness, sauna, zabiegi relaksacyjne.'),(10,1,399.00,40,220,'Lwów','Kraków',3,'2005-07-28 13:00:00','Cena zawiera: - przejazd autokarem (klimatyzacja, toaleta, caffe bar, wideo) - 2 noclegi we Lwowie (pok. 2-4 os. z pełnym wezłem sanitarnym) - 2 śniadania - 2 obiakolacje - opieka pilota- przewodnika - ubezpieczenie KL + NW + bagaż - zwiedzanie Lwowa z przewodnikiem Lwowskim - gorące napoje w czasie drogi'),(11,1,300.00,40,193,'Czerwony Klasztor','Kraków',1,'2005-05-09 07:00:00','ŚWIADCZENIA: - przejazd autokarem lux (klimatyzacja, barek, wideo, toaleta)  - opieka przewodnika   - ubezpieczenie KL+NNW  - podatek VAT'),(12,1,150.00,40,220,'Lwów','Kraków',2,'2005-12-02 12:00:00','ŚWIADCZENIA: - przejazd autokarem lux (klimatyzacja, barek, wideo, toaleta)   - nocleg (pokoje 2+3 z łazienkami)  - śniadanie   - obiadokolacja   - opieka pilota  - polskojęzyczny przewodnik lwowski   - ubezpieczenie KL, NNW + bagaż  - podatek VAT '),(13,1,440.00,50,53,'Praga','Kraków',3,'2005-06-05 13:00:00','ŚWIADCZENIA: - przejazd autokarem lux (klimatyzacja, barek, wideo, toaleta)   - 2 noclegi (pokoje 2+3 z łazienkami)  - 2 śniadania  - 2 obiadokolacje  - opieka pilota- przewodnika - przewodnik czeski (HRADCZANY)   - ubezpieczenie KL, NNW + bagaż  - podatek VAT '),(14,1,500.00,30,53,'Kutna Hora','Kraków',4,'2005-08-17 09:00:00','ŚWIADCZENIA: - przejazd autokarem lux (klimatyzacja, barek, wideo, toaleta)  - 3 noclegi ze śniadaniami w hotelu w Pradze (pok. 2,3 os. Z łazienkami)  - 2 obiadokolacje w restauracji oraz 1 obiadokolacja na statku w czasie rejsu  - opieka pilota, zwiedzanie miast z pilotem  - ubezpieczenie KL+NW'),(15,1,200.00,30,127,'Wilno','Kraków',5,'2005-10-14 17:00:00','ŚWIADCZENIA: - przejazd autokarem lux (klimatyzacja, barek, wideo, toaleta)  - 2 noclegi  - 2 śniadania  - 1 obiad  - 1 obiadokolacja w hotelu w Wilnie (pokoje 2,3 os. Z łazienkami)  - opieka pilota, zwiedzanie miast z pilotem  - ubezpieczenie KL+NW'),(16,1,39.00,35,172,'Krynica','Kraków',1,'2005-02-10 08:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(17,1,39.00,35,172,'Szczawnica','Kraków',1,'2005-07-20 14:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(18,1,39.00,30,172,'Łańcut','Kraków',1,'2005-05-05 16:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(19,1,44.00,35,172,'Tarnowskie Góry','Kraków',1,'2005-06-15 09:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(20,1,59.00,40,172,'Wrocław','Kraków',1,'2005-02-17 09:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(21,1,109.00,40,172,'Zakopane','Kraków',2,'2005-02-01 11:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika  - nocleg - śniadanie - obiadokolacja - ubezpieczenie - opłaty parkingowe');
