INSERT INTO `toferta` VALUES (1,'\0',595.00,30,65,'Lloret de Mar','Kraków',30,'2056-07-18 11:00:00','Hotel ASTORIA *** położony w centrum miasta, oddalony ok. 5 min. pieszo od plaży. Jest to średniej wielkości hotel (230 pokoi), oferujący serwis hotelowy na wysokim poziomie. Pokoje są 2 osobowe z możliwością dostawek, każdy z balkonem, klimatyzacją , łazienką i telefonem. W hotelu znajduje się restauracja, sala z TV-SAT, sala gier, basen , bilard, sejf. Hotel oferuje szeroki wachlarz rozrywek: dyskoteki oraz program animacyjny dla dzieci i dorosłych. WYŻYWIENIE 3 x dziennie w formie bufetu szwedzkiego (do lunchu i kolacji napoje płatne dodatkowo). '),(3,'\0',1090.00,20,65,'Callela','Kraków',20,'2056-09-02 12:00:00','Hotel ESPLAI ***+ położony jest około 300 m od plaży i w bliskiej odległości od centrum miasta, polecany dla rodzin z dziećmi. Oficjalna kategoria - trzy gwiazdki. Do dyspozycji gości klimatyzowana restauracja, drink bar, lobby bar, snack bar przy basenie, sala klubowa, sala telewizyjna, recepcja czynna całą dobę, hol, winda, przechowalnia bagażu.Pokoje klimatyzowane 2,3, 4 - osobowe z łazienką (prysznic, wc) i balkonem. Wszystkie pokoje wyposażone są w TV SAT \ni telefon.WYŻYWIENIE: Trzy posiłki: śniadania, obiady i kolacje podawane w formie bufetu.Sport i rozrywka: Na terenie hotelu znajduje się basen dla dorosłych, leżaki przy basenie bezpłatnie oraz mały basen dla dzieci, jacuzzi, bilard, automaty do gier. Wieczorem odbywają się programy rozrywkowe z muzyką i tańcami.'),(4,'\0',595.00,20,65,'Malgrat de Mar','Kraków',14,'2056-10-12 20:00:00','Hotel SORRA DAURADA *** położony jest ok. 50 m od morza i 150 m od centrum. Oferuje miłą atmosferę oraz świetny serwis usług hotelowych. Pokoje są 2 osobowe z możliwością dostawek, każdy z balkonem, klimatyzacją , łazienką, telefonem i TV SAT (kaucja za pilota - 20 EUR). W hotelu znajdują się restauracja, bar, sala z TV-SAT , windy, sejf, basen . W hotelu można skorzystać z programu animacyjnego dla dzieci i dorosłych: przedstawienia, muzyka na żywo, dyskoteki, pokazy flamenco, W pobliżu hotelu płatny parking (potrzebna wcześniejsza rezerwacja). WYŻYWIENIE 3 x dziennie w formie bufetu szwedzkiego (do lunchu i kolacji napoje płatne dodatkowo).'),(5,'\0',580.00,30,65,'Malgrat de Mar','Kraków',14,'2056-01-29 12:00:00','Hotel SORRA DIOR *** położony w centrum Malgrat, 30 m. od plaży, posiada pokoje 2 osobowe z możliwością dostawek, każdy z balkonem, łazienką, TV SAT i telefonem. W hotelu znajduje się bar z napojami, sala z TV-SAT, sala gier, basen , windy, bilard, sejf. Dogodne położenie hotelu i sympatyczna atmosfera sprawiają że turyści miło wspominają pobyt. WYŻYWIENIE 3 x dziennie w formie bufetu szwedzkiego.'),(6,'\0',580.00,30,65,'Santa Susana','Kraków',14,'2056-10-02 15:00:00','HOTEL RIVIERA *** położony 50 m. od plaży, posiada gustownie urządzone klimatyzowane pokoje z balkonami. W każdym łazienka , telefon, TV - SAT. Przy hotelu znajduje się basen z leżakami i parasolami oraz niewielki plac zabaw dla dzieci. W hotelu: cafe - bar, windy, sejf, sala telewizyjna, bilard. Wieczorne animacje oraz propozycje bogatego programu aktywnego wypoczynku w dodatkowy sposób uatrakcyjniają pobyt w tym obiekcie.WYŻYWIENIE 3 x dziennie w formie bufetu szwedzkiego.'),(9,'\0',470.00,36,85,'Peloponez','Kraków',28,'2056-12-28 10:00:00','APARTAMENTY PANORAMA: przestronne, luksusowo urządzone, z klimatyzacją, o łącznej powierzchni ok. 90m2 przeznaczone dla 4-6 osób. Składają się z 2 osobnych sypialni, pokoju dziennego z dodatkowym miejscem do spania i w pełni wyposażonym aneksem kuchennym, łazienki, balkonu lub tarasu. Usytuowane w odległości ok.50 m od czystej piaszczystej plaży rozciągającej się na długości 9 km. WYŻYWIENIE: we własnym zakresie.'),(10,'\0',610.00,15,22,'Sozopol','Kraków',7,'2056-12-08 14:00:00','Hotel SPARTAK ** (wg naszej oceny ***) obiekt należący do Narodowego Ośrodka Sportu, usytuowany w malowniczym parku, w odległości ok. 150 m. od plaży. Pokoje oferują miejsce dla 2, 3 osób, wybrane nawet dla 4 (za sprawą szerokiego łóżka, które pomieści dwie osoby). Wszystkie pokoje są po remoncie, posiadają balkony, klimatyzację, lodówkę TV-SAT i czajniki elektryczne, filiżanki. Każdy pokój wyposażony jest w nowoczesne łazienki. Istnieje możliwość korzystania z sejfu hotelowego, siłowni, tenisa stołowego (płatne dodatkowo).Hotel Krystian *** - kameralny hotel z basenem, położony ok. 10 min od plaży. Obiekt oferuje apartamenty (bez kuchni) składające się z: sypialni, pokoi dziennych (możliwość wykorzystania ich jako dodatkowej sypialni) i łazienek. Wszystkie apartamenty wyposażone są w TV-SAT, klimatyzację, lodówkę, balkony. Dostępne są również (w ofercie autokarowej) pokoje 2 osobowe z łazienkami, TV-SAT, lodówką i balkonami . Hotel dysponuje barem i restauracją. WYŻYWIENIE śniadania serwowane w restauracji hotelowej 1 x dziennie (BB)'),(12,'\0',610.00,22,22,'Pomorie','Kraków',12,'2056-02-03 18:00:00','APARTAMENTY to samodzielne mieszkania, 4 osobowe posiadają 2 sypialnie , 2 osobowe posiadają 1 sypialnię, łazienkę i kuchnię z podstawowym wyposażeniem do przyrządzania posiłków, kuchenką i lodówką. WYŻYWIENIE: we własnym zakresie lub na zamówienie.'),(17,'\0',840.00,40,94,'Solaris','Kraków',18,'2056-03-06 15:00:00','Położenie: obiekt znajduje się w lasku piniowym, ok. 50 m od atrakcyjnej 3 km polaży.Pokoje: klimatyzowane 2- osobowe z możliwością dostawki, klimatyzacją , łazienką (prysznic/WC) z suszarka do włosów, TV-SAT , telefonem, , balkonem.Wyżywienie: śniadania i obiadokolacje w formie bufetu szwedzkiego (napoje do obiadokolacji płatne dodatkowo), powitalny drink w dniu przyjazdu, raz w tygodniu kolacja dalmatyńska.'),(19,'',339.00,40,53,'Praga','Kraków',3,'2056-05-09 19:00:00','Cena zawiera: - przejazd autokarem (klimatyzacja, toaleta, caffe bar, wideo) - nocleg (pok. 2-4 os. z pełnym węzłem sanitarnym) - śniadanie - obiadokolacja - opieka pilota- przewodnika - polskojęzyczny przewodnik czeski - ubezpieczenie KL + NW + bagaż - gorące napoje w czasie drogi'),(20,'',350.00,50,13,'Wiedeń','Kraków',1,'2056-08-13 08:00:00','Cena zawiera: - przejazd autokarem (klimatyzacja, toaleta, caffe bar, wideo) - opieka pilota- przewodnika - polskojęzyczny przewodnik wiedeński - ubezpieczenie KL + NW + bagaż - gorące napoje w czasie drogi'),(21,'',400.00,40,220,'Lwów','Kraków',1,'2056-09-28 18:00:00','Cena zawiera: - przejazd autokarem (klimatyzacja, toaleta, caffe bar, wideo) - opieka pilota- przewodnika - polskojęzyczny przewodnik lwowski - ubezpieczenie KL + NW + bagaż - gorące napoje w czasie drogi'),(23,'',250.00,40,193,'Beseniowa','Kraków',1,'2056-07-16 13:00:00','ŚWIADCZENIA: - przejazd autokarem lux (klimatyzacja, barek, wideo, toaleta)  - opieka pilota   - ubezpieczenie KL+NNW  - podatek VAT'),(28,'',500.00,50,96,'Budapeszt','Kraków',3,'2056-08-16 12:00:00','ŚWIADCZENIA:  - przejazd autokarem lux (klimatyzacja,barek,wideo, toaleta)    - 2 noclegi (pokoje 2-4 os. z łazienkami)   - 2 śniadania   - 1 obiadokolacja w Budapeszcie w restauracji przy muzyce węgierskiej   - opieka pilota, zwiedzanie miasta z pilotem    -  ubezpieczenie KL+NNW+bagaż   - podatek VAT od kwoty złotówkowej'),(30,'',39.00,40,172,'Zakopane','Kraków',1,'2056-10-01 09:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(33,'',39.00,40,172,'Ojców','Kraków',1,'2056-01-06 16:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(35,'',45.00,35,172,'Oświęcim','Kraków',1,'2056-07-03 17:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika - ubezpieczenie - opłaty parkingowe'),(38,'',119.00,50,172,'Bieszczady','Kraków',2,'2056-02-13 10:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika  - nocleg - śniadanie - obiadokolacja - ubezpieczenie - opłaty parkingowe'),(39,'',109.00,40,172,'Szczawnica','Kraków',2,'2056-10-09 16:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka przewodnika  - nocleg - śniadanie - obiadokolacja - ubezpieczenie - opłaty parkingowe'),(41,'',109.00,40,172,'Wrocław','Kraków',2,'2056-04-08 13:00:00','ŚWIADCZENIA: - przejazd autokarem - opieka pilota - przewodnicy miejscy - nocleg - ubezpieczenie - opłaty parkingowe');
